import React, {useEffect, useState} from "react";
import {useSelector} from "react-redux";


const ExtensionsList = () => {
    const extensionsList = useSelector(state => state.devicesData);
    const loginData = useSelector(state => state.loginData);
    const [myExtensions, getMyExtensions] = useState([]);
    const findRosterStatus = () => {
        const items = extensionsList.item.filter(i => i.owner_id === loginData.item[0].data.owner_id);
        getMyExtensions(items);
    };
    useEffect(() => {
        findRosterStatus()
    },[]);
    return (
        <React.Fragment>
            <ul>
                {
                    myExtensions.map((item, i) => {
                        <li key={i}>
                            <a>{item}</a>
                        </li>
                    })
                }
            </ul>
        </React.Fragment>
    )
}


export default ExtensionsList;
